-- Drop table

-- DROP TABLE episode.applabel;

CREATE TABLE episode.applabel (
	id int4 NOT NULL,
	app_id varchar(20) NOT NULL,
	"name" varchar(30) NOT NULL,
	description varchar(100) NOT NULL,
	lang varchar(10) NOT NULL,
	create_dt timestamp NOT NULL DEFAULT timezone('utc'::text, CURRENT_TIMESTAMP),
	create_id varchar(20) NULL DEFAULT NULL::character varying,
	update_dt timestamp NOT NULL DEFAULT timezone('utc'::text, CURRENT_TIMESTAMP),
	update_id varchar(20) NULL DEFAULT NULL::character varying,
	CONSTRAINT applabel_idx1 PRIMARY KEY (id),
	CONSTRAINT applabel_idx2 UNIQUE (app_id, name, lang)
);
CREATE INDEX applabel_idx3 ON episode.applabel USING btree (app_id);
CREATE INDEX applabel_idx4 ON episode.applabel USING btree (app_id, lang);

